def get_day_str(day):
    if day==0:
        return "Mon"
    elif day==1:
        return "Tue"
    elif day==2:
        return "Wed"
    elif day==3:
        return "Thu"
    elif day==4:
        return "Fri"
    elif day==5:
        return "Sat"
    elif day==6:
        return "Sun"
    else:
        raise ValueError("Unsupported Day!")

def get_shift_name(label):
    if label=='D':
        return "Day"
    elif label=='N':
        return "Night"
    elif label=='L':
        return "Late"
    elif label=='E':
        return "Early"
    else :
        raise ValueError("Unsupported Shift!")

def get_task_name(label):
    if label=='He':
        return "HeadNurse"
    elif label=='Nu':
        return "Nurse"
    elif label=='Ca':
        return "Caretaker"
    elif label=='Tr':
        return "Trainee"
    else :
        raise ValueError("Unsupported Shift!")


